var MAX_DEPTH = 10;

// if queue doesn't exist, create it
context.queue = context.queue || [];
context.pass = context.pass || false;

// Use MQTT connected status to gate flow
if (msg.hasOwnProperty("status")) {
    if (msg.status.text.indexOf(".connected") !== -1) { 
        setTimeout(function() { 
            while (context.queue.length > 0) {
                var m = context.queue.shift();
                node.send(m); 
            }
            context.pass = true; 
            node.status({});
        },5);
    }
    else { context.pass = false; }
}
else {
    if (context.pass) { return msg; }
    else { 
        context.queue.push(msg); 
        if (context.queue.length > MAX_DEPTH) { context.queue.shift(); }
        node.status({text:context.queue.length});
    }
}
return null;

let redis = context.flow.get('redis');

redis.info().then((data)=>{
    msg.payload = data
    node.send(msg);
})

